-- Name: fn_get_cifrado(character varying, text); Type: FUNCTION; Schema: app; Owner: -
--

CREATE FUNCTION app.fn_get_cifrado(lscadena character varying, lscifrado text DEFAULT 'sha256'::text) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
declare
	-- select public.fn_get_cifrado('hola','md5');	
begin
	/*
		Posibles valores lsCifrado:
		{md5, sha1, sha224, sha256, sha384, sha512}
	*/
	return encode(digest(lsCadena, lsCifrado), 'hex')::varchar;
end;

$$;


--
-- TOC entry 967 (class 1255 OID 3146794)
-- Name: fn_validar_sesion_activa(character varying, integer); Type: FUNCTION; Schema: app; Owner: -
--

CREATE FUNCTION app.fn_validar_sesion_activa(ls_id_session character varying, timeout integer DEFAULT 15) RETURNS boolean
    LANGUAGE plpgsql
    AS $$


declare

	lbReturn boolean := false;
	
	ltmCorte timestamp := (now() - (timeout|| ' minute')::interval);

	--select app.fn_validar_sesion_activa('GlLBj6yADmpGa-ByhAp1c71Sqkv72lXaK0L2w6C1',1);
	
begin


	if exists (select 1 from app.vst_ultimo_log_x_usuario t where t.accion not in ('LOGOUT') and t.fecha >= ltmCorte and t.id_session = ls_id_session) then
		lbReturn := true;
		
		insert into app.tbl_log(id_usuario, detalles)
		select
		  q.id_usuario, q.detalles
		from (select l.*, rank() over (order by id_log desc) rk
		      from app.tbl_log l
		      where l.detalles->>'id_session' = ls_id_session) q
		where q.rk = 1;
	else
		insert into app.tbl_log(id_usuario, detalles)
		select
		  q.id_usuario, (q.detalles || jsonb_build_object('tp_accion','LOGOUT'))
		from (select l.*, rank() over (order by id_log desc) rk
		      from app.tbl_log l
		      where l.detalles->>'id_session' = ls_id_session) q
		where q.rk = 1;		
	end if;
		     
	return lbReturn;

end;

$$;


--
-- TOC entry 968 (class 1255 OID 3146337)
-- Name: sp_log_crud(character varying); Type: FUNCTION; Schema: app; Owner: -
--

CREATE FUNCTION app.sp_log_crud(lsinput character varying DEFAULT '{}'::character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$

declare
	ljdata jsonb := lsInput::jsonb;
	ljReturn jsonb;
	lsOperacion varchar := upper(ljdata->>'operacion');
begin

	/*--/-** Nomenclatura **-\--

	  1 => 'Succefull'
	  0 => 'Error'
	  -1 => 'Error Conexión DB'
	  -2 => 'No se definió Operación'

	--\-** Nomenclatura **-/--*/

	-- select app.sp_log_crud(jsonb_build_object('operacion','CREATE','id_usuario','21','id_session','yeocPvxRcIshTL1ZqohAMEcdQopRU9r3lAc9AFXQ',
	--'tp_accion','CLIC','url','http://172.16.0.113:55129/reservas/index.html','ip','172.16.1.15')::varchar);

	discard temp;
	set schema 'app';

		if lsOperacion = 'CREATE' then
			
			if ((ljdata->>'id_usuario') || (ljdata->>'id_session') || (ljdata->>'tp_accion') || ((ljdata->>'url'))) is null then
			
				ljReturn := jsonb_build_object('codigo','0','descripcion','NO ESTA EL TOTAL DE LOS CAMPOS NECESARIOS');

			elsif exists (select 1
				     from (select lx.*, rank() over (order by lx.fecha_registro desc) rk 
					   from tbl_log lx 
					   where lx.id_usuario = (ljdata->>'id_usuario')::bigint
					     and lx.fecha_registro >= now()::date) l
				      where l.rk = 1
				        and l.fecha_registro >= (now() - '10 minute'::interval)
				        and l.detalles->>'id_session' != (ljdata->>'id_session')
				        and (ljdata->>'tp_accion') not in ('LOGIN','CHANGEPASS')) then

				ljReturn := jsonb_build_object('codigo','0','descripcion','Upps, Ya existe una sesion activa desde otro navegador.');
								
			else

				insert into tbl_log(id_usuario, detalles)
				select
				  (ljdata->>'id_usuario')::bigint
				  ,jsonb_build_object('id_session',ljData->>'id_session'
						     ,'tp_accion',ljData->>'tp_accion'
						     ,'url',ljData->>'url'
						     ,'ip',ljData ->> 'ip');
				
				ljReturn := jsonb_build_object('codigo','1','descripcion','CREATE EJECUTADO CON EXITO');
				
			end if;
		elsif lsOperacion = 'VALIDATE' then
			ljReturn := jsonb_build_object('activo',fn_validar_sesion_activa((ljdata ->> 'id_session')));			
		elsif lsOperacion = 'UPDATE' then
			ljReturn := jsonb_build_object('codigo','1','descripcion','UPDATE EJECUTADO CON EXITO');
		elsif lsOperacion = 'READ' then
			ljReturn := jsonb_build_object('codigo','1','descripcion','READ EJECUTADO CON EXITO');
		elsif lsOperacion = 'DELETE' then
			ljReturn := jsonb_build_object('codigo','1','descripcion','DELETE EJECUTADO CON EXITO');
		end if;

	return ljReturn;
		
	discard temp;

end;


$$;


