CREATE FUNCTION app.sp_reserva_crud(lsinput character varying DEFAULT '{}'::character varying) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
	declare
	ljdata jsonb := lsinput::jsonb;
	ljReturn jsonb;
