	lsemail varchar;
	lspass varchar;
	lsqueryUpdate varchar;
	lsHoraIni varchar:= substring(ljdata->>'hora_inicio',1,2);
	lsHoraFin varchar:= substring(ljdata->>'hora_fin',1,2);
	lsSubstr varchar;
	lsResult int;
	lsResult2 int;

begin

	/*--/-** Nomenclatura **-\--

	  1 => 'Succefull'
	  0 => 'Error'
	  -1 => 'Error Conexión DB'
	  -2 => 'No se definió Operación'

	--\-** Nomenclatura **-/--*/


	discard temp;
	set schema 'app';

		if lsOperacion = 'CREATE' then

			if ((ljdata->>'id_usuario') || (ljdata->>'id_precio') || (ljdata->>'id_sala') 
			|| (ljdata->>'fecha_reserva') ||(ljdata->>'hora_inicio') || (ljdata->>'pago_realizado')) is null then
			
				ljReturn := jsonb_build_object('codigo','0','descripcion','NO ESTA EL TOTAL DE LOS CAMPOS NECESARIOS PARA LA CREACION DE LA RESERVA');
				
			else
																															  
			/*
				select app.sp_reserva_crud(
				'{"operacion":"CREATE","nombre_empresa":"cuevaCebra","id_usuario":1,"id_precio":7,"id_sala":2,"fecha_reserva":"2019-04-21","hora_inicio":"08:00","hora_fin":"09:00","pago_realizado":0,"detalles":"N/A"}');

			*/
				
				
			lsSubstr:= 'select count(1) from app.tbl_calendario_reservas where ((h_'||(lsHoraIni)||'->'''||(ljdata->>'nombre_empresa')||'''->>'''||(ljdata->>'id_sala')
				||''')::json)->>''estado''= ''disponible'' and fecha='''||(ljdata->>'fecha_reserva')||''';';  	
			
			execute lsSubstr into lsResult;
			
			lsSubstr:= 'select count(1) from app.tbl_calendario_reservas where ((h_'||(lsHoraFin)||'->'''||(ljdata->>'nombre_empresa')||'''->>'''||(ljdata->>'id_sala')
				||''')::json)->>''estado''= ''disponible'' and fecha='''||(ljdata->>'fecha_reserva')||''';';  	
		
			execute lsSubstr into lsResult2;
				
				if (lsResult+lsResult2)>1 then
			
					insert into app.tbl_reserva(id_usuario,id_precio,id_sala,fecha_reserva,hora_inicio,hora_fin,detalles,pago_realizado,nombre_empresa)
					values(
						(ljdata->>'id_usuario')::int
						,(ljdata->>'id_precio')::int
						,(ljdata->>'id_sala')::int
						,(ljdata->>'fecha_reserva')::date
						,(ljdata->>'hora_inicio')::time
						,(ljdata->>'hora_fin')::time
						,jsonb_build_object('adicionales',ljdata->>'detalles')
						,0
						,(ljdata->>'nombre_empresa')::text
					);
				
				-----ACTUALIZAR LA DISPONIBILIDAD SEGUN LA HORA DE INICIO
				
					lsqueryUpdate:= 'update app.tbl_calendario_reservas set h_'||(lsHoraIni)
					||' = jsonb_set(h_'||(lsHoraIni)||',''{'
					||(ljdata->>'nombre_empresa')||','||(ljdata->>'id_sala')||','||'estado}'','||'''"reservado"'')'
					||' where fecha = '''||(ljdata->>'fecha_reserva')||'''';
				
					execute lsqueryUpdate;
				
					lsqueryUpdate:= 'update app.tbl_calendario_reservas set h_'||(lsHoraIni)
					||' = jsonb_set(h_'||(lsHoraIni)||',''{'
					||(ljdata->>'nombre_empresa')||','||(ljdata->>'id_sala')||','||'id_usuario}'','||'''"'||(ljdata->>'id_usuario')||'"'')'
					||' where fecha = '''||(ljdata->>'fecha_reserva')||'''';
					
					execute lsqueryUpdate;
				
				--------ACTUALIZAR LA DISPONIBILIDAD SEGUN LA HORA DE FIN
				
				lsqueryUpdate:= 'update app.tbl_calendario_reservas set h_'||(lsHoraFin)
					||' = jsonb_set(h_'||(lsHoraFin)||',''{'
					||(ljdata->>'nombre_empresa')||','||(ljdata->>'id_sala')||','||'estado}'','||'''"reservado"'')'
					||' where fecha = '''||(ljdata->>'fecha_reserva')||'''';
				
					execute lsqueryUpdate;
				
					lsqueryUpdate:= 'update app.tbl_calendario_reservas set h_'||(lsHoraFin)
					||' = jsonb_set(h_'||(lsHoraFin)||',''{'
					||(ljdata->>'nombre_empresa')||','||(ljdata->>'id_sala')||','||'id_usuario}'','||'''"'||(ljdata->>'id_usuario')||'"'')'
					||' where fecha = '''||(ljdata->>'fecha_reserva')||'''';
					
					execute lsqueryUpdate;
				

					ljReturn := jsonb_build_object('codigo','1','descripcion','CREATE EJECUTADO CON EXITO');
				else 
			
					ljReturn := jsonb_build_object('codigo','0','descripcion','NO HAY DISPONIBILIDAD EN ESA FECHA Y HORAS');
				end if;
	
				
				
			end if;
			
			
		elsif lsOperacion = 'READ' then

				ljReturn := jsonb_build_object('codigo','0','descripcion','OPCION DESHABILITADA');

		elsif lsOperacion = 'UPDATECALENDAR' then
			
			ljReturn := jsonb_build_object('codigo','1','descripcion','RESERVA ACTUALIZADA');

		elsif lsOperacion = 'DELETE' then

			ljReturn := jsonb_build_object('codigo','0','descripcion','OPCION DESHABILITADA');
		
		else
			ljReturn := jsonb_build_object('codigo','0','descripcion','LOS DATOS EN LA FUNCION ESTAN INCOMPLETOS O ERRADOS');
	
	end if;

	return ljReturn;
	
	discard temp;

end;
$$;


