			if (ljdata->>'usuario' is not null) then

				ljReturn := (select to_jsonb(u.*) - 'clave' from tbl_usuario u where u.usuario = (ljdata->>'usuario'));

			elsif (ljdata->>'identificacion' is not null) then

				ljReturn := (select to_jsonb(u.*) - 'clave' from tbl_usuario u where u.identificacion = ljdata->>'identificacion');

			end if;

			if ljReturn is null then
				ljReturn := jsonb_build_object('codigo','0','descripcion','EL USUARIO NO EXISTE');
			end if;

		elsif lsOperacion = 'UPDATE' then
			update tbl_usuario
			set identificacion = ljdata->>'identificacion'
			where usuario = ljdata->>'usuario';
		
			update tbl_usuario
			set nombre = ljdata->>'nombre'
			where usuario = ljdata->>'usuario';
				
			update tbl_usuario
			set apellido = ljdata->>'apellido'
			where usuario = ljdata->>'usuario';	
			
			update tbl_usuario
			set fecha_nacimiento = (ljdata->>'fecha_nacimiento')::date
			where usuario = ljdata->>'usuario';
		
			update tbl_usuario
			set direccion = ljdata->>'direccion'
			where usuario = ljdata->>'usuario';	
			
			update tbl_usuario
			set telefono = ljdata->>'telefono'
			where usuario = ljdata->>'usuario';			
		
			update tbl_usuario
			set correo_electronico = ljdata->>'email'
			where usuario = ljdata->>'usuario';
	
			ljReturn := jsonb_build_object('codigo','1','descripcion','USUARIO ACTUALIZADO CON EXITO');

		elsif lsOperacion = 'DELETE' then

			ljReturn := jsonb_build_object('codigo','0','descripcion','OPCION DESHABILITADA');
		
		elsif lsOperacion = 'AUTENTICATE' then

			-- Return:
			-- evento: 0 error
			-- evento: 1 usuario logeado
			-- evento: 2 usuario con cambio de clave
			
			--select app.sp_usuario_crud('{"operacion":"AUTENTICATE","usuario":"sbarrera","clave":"123"}');
						
			ljReturn := (select jsonb_build_object('codigo', case when vigencia then '1' else '2' end,'descripcion',case when vigencia then 'Usuario logueado' else 'Usuario con cambio de clave' end)
				     from (select q.datos->>'clave' clave, (q.datos->>'caducidad')::date >= now()::date vigencia 
						from (select u.clave datos from tbl_usuario u where u.usuario = ljdata->>'usuario') q) qq
				     where qq.clave = ljdata->>'clave');

			if ljReturn is null then
				ljReturn := jsonb_build_object('codigo','0','descripcion','Verifique su usuario y su clave.');
			end if;

			if (ljReturn ->> 'codigo' != '0' and ljReturn ->> 'codigo' != '2') then
				ljReturn := ljReturn || (select jsonb_build_object('identificacion',u.identificacion,'nombre',initcap(u.nombre),'apellido',initcap(u.apellido),'id_usuario',u.id_usuario, 'usuario', u.usuario)
							 from app.tbl_usuario u 
								where u.usuario = ljdata ->> 'usuario' limit 1);
			end if;	
			
		elsif lsOperacion = 'RECOVERPASS' then	
			-- evento: 0 contraseña ya registrada
			-- evento: 1 cambio de contraseña exitoso			
			if (ljdata ->> 'identificacion' is not null) then

				lsEmail := (select coalesce(u.detalles ->> 'email',u.correo_electronico)  from tbl_usuario u where public.fn_get_cifrado(u.identificacion) = (ljdata ->> 'identificacion'));
				
				if lsEmail is null then
					
					ljReturn := jsonb_build_object('codigo','0','descripcion','Upps, El usuario no esta registrado');
				else 
					lsPass := substring(public.fn_get_cifrado(now()::text) from (random()*10)::int for 8); 								
					
					update tbl_usuario u
					set clave = clave || jsonb_build_object('clave',public.fn_get_cifrado(lsPass),'caducidad',to_char((select now()::date + interval '1 year'),'YYYY-MM-DD'))
					where public.fn_get_cifrado(u.identificacion) = (ljdata ->> 'identificacion');

					ljReturn := jsonb_build_object('codigo','1','descripcion','Hemos enviado a tu correo personal una clave temporal para restaurar tu ingreso.','clave',lsPass,'email',lsEmail);

					-- select app.sp_usuario_crud_dev(jsonb_build_object('operacion','RECOVERPASS','identificacion','b8743760b8d897760358698d0357e101')::varchar)
					
				end if;			
			else 
				ljReturn := jsonb_build_object('codigo','0','descripcion','Upps, llave usuario nula');
			end if;

		
		elsif lsOperacion = 'CHANGEPASS' then

			-- evento: 0 ERROR al generar una nueva contraseña
			-- evento: 1 cambio de contraseña exitoso
			-- evento: 2 No se encontro usuario

			

			if (ljdata ->> 'usuario' is not null) then
				if not exists (select 1 from tbl_usuario u where u.usuario = (ljdata ->> 'usuario')) then
					ljReturn := jsonb_build_object('codigo','2','descripcion','No existe el usuario');
				else
						update tbl_usuario u
						set clave = jsonb_build_object('clave',ljdata ->> 'clave','caducidad',to_char((select now()::date + interval '1 year'),'YYYY-MM-DD'))
						where u.id_usuario = ljdata ->> 'usuario';

						ljReturn := jsonb_build_object('codigo','1','descripcion','Cambio de contraseña exitoso');	
				end if;			
			else 
				ljReturn := jsonb_build_object('codigo','2','descripcion','llave usuario nula');
			end if;
		end if;

	return ljReturn;
	
	discard temp;

end;
$$;


