--

CREATE FUNCTION public.fn_get_cifrado(lscadena character varying, lscifrado text DEFAULT 'sha256'::text) RETURNS character varying
    LANGUAGE plpgsql
    AS $$
declare
	-- select public.fn_get_cifrado('hola','md5');	
begin
	/*
		Posibles valores lsCifrado:
		{md5, sha1, sha224, sha256, sha384, sha512}
	*/
	return encode(digest(lsCadena, lsCifrado), 'hex')::varchar;
end;

$$;


